// 转录回调
void transcript_callback(const void *text_data, size_t text_len, void *user_data) {
    printf("Received text: %.*s\n", (int)text_len, (char *)text_data);
}

// 翻译回调
void translation_callback(const void *text_data, size_t text_len, void *user_data) {
    printf("Received translation: %.*s\n", (int)text_len, (char *)text_data);
}

void error_callback(const char* code, const char *message, void *user_data) {
    printf("Received error code: %s, message: %s\n", code, message);
}

void done_callback(void *user_data) {
    printf("Response done\n");
}

void create_session(aigw_ws_translation_session_t *session) {
    aigw_ws_translation_session_t *session_ptr = session;

    // 填充 input_audio_format
    session_ptr->input_audio_format = "pcm16";

    // 填充 modalities
    session_ptr->num_modalities = 1;
    session_ptr->modalities = (const char**)malloc(sizeof(const char*) * session_ptr->num_modalities);
    if (session_ptr->modalities) {
        session_ptr->modalities[0] = "text";
    }

    // 填充 input_audio_translation
    session_ptr->input_audio_translation.source_language = "zh";
    session_ptr->input_audio_translation.target_language = "en";

    // 填充 add_vocab
    // hot_word_list 为空，num_hot_words 默认为 0 (因为 memset)
    session_ptr->input_audio_translation.add_vocab.num_hot_words = 0;
    session_ptr->input_audio_translation.add_vocab.hot_word_list = NULL; // 或者 malloc(0)

    // 填充 glossary_list
    session_ptr->input_audio_translation.add_vocab.num_glossary_items = 1;
    session_ptr->input_audio_translation.add_vocab.glossary_list = (aigw_ws_glossary_item_t*)malloc(sizeof(aigw_ws_glossary_item_t) * session_ptr->input_audio_translation.add_vocab.num_glossary_items);
    if (session_ptr->input_audio_translation.add_vocab.glossary_list) {
        session_ptr->input_audio_translation.add_vocab.glossary_list[0].input_audio_transcription = "火山引擎智能创作平台";
        session_ptr->input_audio_translation.add_vocab.glossary_list[0].input_audio_translation = "volcengine creative cloud";
    }
}

void* keepalive_thread(void *arg) {
    onesdk_ctx_t *ctx = (onesdk_ctx_t *)arg;
    onesdk_rt_session_keepalive(ctx);
    return NULL;
}

int main() {
    onesdk_config_t *config = malloc(sizeof(onesdk_config_t));
    if (NULL == config) {
        return VOLC_ERR_INIT;
    }
    memset(config, 0, sizeof(onesdk_config_t));

    // 初始化配置
    iot_basic_config_t device_config = {
        .http_host = SAMPLE_HTTP_HOST,
        .instance_id = SAMPLE_INSTANCE_ID,
        .auth_type = ONESDK_AUTH_DYNAMIC_NO_PRE_REGISTERED,
        .product_key = SAMPLE_PRODUCT_KEY,
        .product_secret = SAMPLE_PRODUCT_SECRET,
        .device_name = SAMPLE_DEVICE_NAME,
        .device_secret = SAMPLE_DEVICE_SECRET,
        .verify_ssl = true,
        .ssl_ca_cert = digicert_global_root_g2,
    };
    config->device_config = &device_config;
    config->aigw_path = "/v1/realtime?model=doubao-clasi-s2t";
    config->send_ping = true;
    // config->ping_interval_s = 5;

    onesdk_rt_event_cb_t event_cb = {
        .on_transcript_text = transcript_callback,
        .on_translation_text = translation_callback,
        .on_response_done = done_callback,
        .on_error = error_callback,
    };

    // 初始化onesdk
    onesdk_ctx_t *onesdk_ctx = malloc(sizeof(onesdk_ctx_t));
    if (NULL == onesdk_ctx) {
        return VOLC_ERR_INIT;
    }

    int ret = onesdk_init(onesdk_ctx, config);
    if (ret != 0) {
        return ret;
    }

    onesdk_rt_set_event_cb(onesdk_ctx, &event_cb);
    ret = onesdk_connect(onesdk_ctx);
    if (ret!= 0) {
        return ret;
    }

    // create a keep alive thread
    pthread_t keep_alive_thread;
    pthread_create(&keep_alive_thread, NULL, keepalive_thread, onesdk_ctx);
    
    aigw_ws_translation_session_t session;
    memset(&session, 0, sizeof(aigw_ws_translation_session_t)); // 初始化结构体
    create_session(&session);

    onesdk_rt_translation_session_update(onesdk_ctx, &session);

    free(session.modalities);
    free(session.input_audio_translation.add_vocab.glossary_list);
    
    // 发送请求
    for (int i = 0; i < 11; i++) {
        onesdk_rt_translation_audio_send(onesdk_ctx, data[i], strlen(data[i]), false);
        nanosleep((const struct timespec[]){{0, 100000000L}}, NULL); // 100ms delay between each audi
    }
    onesdk_rt_translation_audio_send(onesdk_ctx, data[11], strlen(data[11]), true);

    sleep(5);
    // 发送请求
    for (int i = 0; i < 11; i++) {
        onesdk_rt_translation_audio_send(onesdk_ctx, data[i], strlen(data[i]), false);
        nanosleep((const struct timespec[]){{0, 100000000L}}, NULL); // 100ms delay between each audi
    }
    onesdk_rt_translation_audio_send(onesdk_ctx, data[11], strlen(data[11]), true);

    sleep(5);
    // 释放keepalive线程
    pthread_cancel(keep_alive_thread);
    pthread_join(keep_alive_thread, NULL);

    // 释放上下文
    onesdk_deinit(onesdk_ctx);
    free(onesdk_ctx);
    onesdk_ctx = NULL;

    free(config);
    config = NULL;
    return 0;
}
